import React from 'react';
import './Content.css';
import Kobe from '../images/Kobe.png';

export default class Content extends React.Component {
    
    render() {
        return(
            <div className="Hero">
                <img src={Kobe} alt="fondKobe" className="fond"></img>
            </div>
        );
    }
}
